  `id` int NOT NULL AUTO_INCREMENT,
  `invoiceId` varchar(255) COLLATE utf8mb4_general_ci NOT NULL,
  `description` varchar(255) COLLATE utf8mb4_general_ci NOT NULL,
  `type` enum('laptop','item','service','report','part','standard') COLLATE utf8mb4_general_ci NOT NULL,
