  `client_name` varchar(100) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `client_phone` varchar(20) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `client_email` varchar(100) COLLATE utf8mb4_general_ci DEFAULT NULL,
