  `serial_number` varchar(100) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `inspection_date` datetime NOT NULL,
  `hardware_status` longtext COLLATE utf8mb4_general_ci,
  `external_images` longtext COLLATE utf8mb4_general_ci,
  `notes` text COLLATE utf8mb4_general_ci,
  `billing_enabled` tinyint(1) DEFAULT '0',
  `amount` decimal(10,2) DEFAULT '0.00',
  `created_at` datetime NOT NULL,
  `updated_at` datetime NOT NULL,
  `admin_id` int DEFAULT NULL,
